window.bookSummaryJSON = "<p>Lumina struggles in her day-to-day life, managing her item shop all by herself. </p> <p>The struggle is real.</p> <p>Her wares often spoil or go out of style before customers have a chance to try them. But that all changes when a new dungeon appears just out of town, and with it, a chance at the life she's always wanted. </p> <p>Strapping on the biggest enchanted sack she can find, she makes herself useful as a pack mule and a dungeon merchant, earning her keep and selling her wares in the thick of the adventure. </p> <p>Being the first merchant in the dungeon gives her an advantage many envy. </p> <p>She'll risk everything to follow her dream to be the greatest merchant to ever live! </p> <p>Health potions, mana potions, stamina potions, and...coffee! </p> <p>Join the adventure, and buy a copy! </p>"; 
